import { useState } from "react";

function ClassTable({ classes, onEdit, onDelete }) {
  const [editingId, setEditingId] = useState(null);
  const [editGrade, setEditGrade] = useState("");
  const [editFee, setEditFee] = useState("");
  const [editTimetable, setEditTimetable] = useState("");

  const startEdit = (cls) => {
    setEditingId(cls.id);
    setEditGrade(cls.grade);
    setEditFee(cls.fee);
    setEditTimetable(cls.timetable || "");
  };

  const saveEdit = (id) => {
    onEdit(id, { grade: editGrade, fee: parseFloat(editFee), timetable: editTimetable });
    setEditingId(null);
  };

  const cancelEdit = () => {
    setEditingId(null);
  };

  return (
    <table className="w-full bg-white shadow rounded overflow-hidden">
      <thead className="bg-gray-200">
        <tr>
          <th className="p-2">Grade</th>
          <th className="p-2">Fee</th>
          <th className="p-2">Teacher</th>
          <th className="p-2">Subjects</th>
          <th className="p-2">Timetable</th>
          <th className="p-2">Actions</th>
        </tr>
      </thead>
      <tbody>
        {classes.map(cls => (
          <tr key={cls.id} className="border-b">
            {editingId === cls.id ? (
              <>
                <td className="p-2">
                  <input value={editGrade} onChange={e => setEditGrade(e.target.value)} className="border p-1"/>
                </td>
                <td className="p-2">
                  <input type="number" value={editFee} onChange={e => setEditFee(e.target.value)} className="border p-1"/>
                </td>
                <td className="p-2">{cls.teacher?.name}</td>
                <td className="p-2">{cls.subjects.map(s => s.name).join(", ")}</td>
                <td className="p-2">
                  <input value={editTimetable} onChange={e => setEditTimetable(e.target.value)} className="border p-1"/>
                </td>
                <td className="p-2 space-x-2">
                  <button onClick={() => saveEdit(cls.id)} className="bg-green-500 text-white px-2 py-1 rounded">Save</button>
                  <button onClick={cancelEdit} className="bg-gray-500 text-white px-2 py-1 rounded">Cancel</button>
                </td>
              </>
            ) : (
              <>
                <td className="p-2">{cls.grade}</td>
                <td className="p-2">{cls.fee}</td>
                <td className="p-2">{cls.teacher?.name}</td>
                <td className="p-2">{cls.subjects.map(s => s.name).join(", ")}</td>
                <td className="p-2">{cls.timetable}</td>
                <td className="p-2 space-x-2">
                  <button onClick={() => startEdit(cls)} className="bg-yellow-500 text-white px-2 py-1 rounded">Edit</button>
                  <button onClick={() => onDelete(cls.id)} className="bg-red-500 text-white px-2 py-1 rounded">Delete</button>
                </td>
              </>
            )}
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default ClassTable;
